import { useState } from "react";
import { useEffect } from "react";
import ConnectContractSR from "./ConnectContractSR";
import ConnectMetamask from "./ConnectMetamask";
let acc
export default function ReceivedReq(){
    const [res,setRes]=useState([]);
    const [ref,setRef]=useState([]);
    const [ref2,setRef2]=useState([]);

    const accept1=async(row)=>{
        await window.contract.methods.acceptreqDDST(row.reqfrom,row.from,row.requestno,localStorage.getItem("ROLENAME")).send({from:account});

    }
    const decline1=async()=>{

    }
    const accept2=async()=>{

    }
    const decline2=async()=>{

    }
  
    
    ConnectMetamask();
    ConnectContractSR();
    useEffect(()=>{
        const fetchdata=async()=>{
            let res=await window.contract.methods.getAllreqreceive(localStorage.getItem("ROLENAME")).call();
		    let res2=await window.contract1.methods.getalladsts(localStorage.getItem("ROLENAME")).call();
            let updated=[...res];
            for(let i=0;i<res2.length;i++){
                for(let j=0;j<updated.length;j++){
                    if(updated[j].reqno===res2[i].reqno && updated[j].from===res2[i].from){
                        updated[j]=res2[i];
                    }
                }
            }
            if(updated.length===0){
               updated=[...res2];
            }
            setRes(updated);
            for(let i=0;i<updated.length;i++){
                let dup_v=await window.contract.methods.getallreqreceivedddst(updated[i].reqfrom).call();	
                let dup_v2=await window.contract1.methods.getallreqreceivedddst(updated[i].reqfrom).call();	
                setRef([...ref,dup_v]);
                setRef2([...ref2,dup_v2]);
                
            }
            
            for(let i=0;i<ref2.length;i++){
                ref.push(ref2[i]);
            }
            
        }
        fetchdata();
        
        
        
    },[]);
    console.log(ref,res);
   

    return (
       
    
   <>
   <div className="container">
   <table id="myTable" className="table table-striped table-hover">
             <thead>
                <tr>
                    <td>Request No</td>
                    <td>Request From</td>
                    <td>From</td>
                    <td>Products</td>
                    <td>Quantities</td>
                    <td>Date</td>
                    <td>Accept</td>
                    <td>Reject</td>
                </tr>
             </thead>
             <tbody>
             {res.map((ele, i) => {
                    
                    return (
                        <tr key={i}>
                        <td>{parseInt(ele.reqno)}</td>
                        <td>{ele.reqfrom}</td>
                        <td>{ele.from}</td>
                        <td>{ele.products}</td>
                        <td>{ele.quantities}</td>
                        <td>{ele.date}</td>
                        <td>
                            {
                                ele.status==="pending" && ref.map((refele,refi)=>(
                                    refele[refi].from===ele.from && refele[refi].reqno===ele.reqno && refele[refi].reqfrom.length===7 && (
                                    <button className="btn btn-dark" onClick={accept1(ele)}>Accept</button>)
                                ))
                            }
                            {
                                ele.status==="pending" && ref.map((refele,refi)=>(
                                    refele[refi].from===ele.from && refele[refi].reqno===ele.reqno && refele[refi].reqfrom.length===4 && (
                                    <button className="btn btn-dark" onClick={accept2} >Accept</button>)
                                ))
                            }
                        </td>
                        <td>
                        {
                                ele.status==="pending" && ref.map((refele,refi)=>(
                                    refele[refi].from===ele.from && refele[refi].reqno===ele.reqno && refele[refi].reqfrom.length===7 && (
                                    <button className="btn btn-dark"  onClick={decline1} >Decline</button>)
                                ))
                            }
                            {
                                ele.status==="pending" && ref.map((refele,refi)=>(
                                    refele[refi].from===ele.from && refele[refi].reqno===ele.reqno && refele[refi].reqfrom.length===4 && (
                                    <button className="btn btn-dark" onClick={decline2} >Decline</button>)
                                ))
                            }
                        </td>
                        
                        
                    </tr>
                    );
            })}

             </tbody>
    </table>
   </div>
   </>
    );
}
